.containerTimeline .workShopButton__1::after, .containerTimeline .workShopButton__2::after, .containerTimeline .workShopButton__3::after, .containerTimeline .workShopButton__4::after, .containerTimeline .workShopButton__5::after, .containerTimeline .workShopButton__6::after, .containerTimeline .workShopButton__7::after, .containerTimeline .workShopButton__8::after, .containerTimeline .workShopButton__9::after, .containerTimeline .workShopButton__10::after, .containerTimeline .workShopButton__11::after, .containerTimeline .workShopButton__12::after, .containerTimeline .workShopButton__13::after, .containerTimeline .workShopButton__14::after {
