}

.containerTimeline .workShopButton__1:hover::after, .containerTimeline .workShopButton__2:hover::after, .containerTimeline .workShopButton__3:hover::after, .containerTimeline .workShopButton__4:hover::after, .containerTimeline .workShopButton__5:hover::after, .containerTimeline .workShopButton__6:hover::after, .containerTimeline .workShopButton__7:hover::after, .containerTimeline .workShopButton__8:hover::after, .containerTimeline .workShopButton__9:hover::after, .containerTimeline .workShopButton__10:hover::after, .containerTimeline .workShopButton__11:hover::after, .containerTimeline .workShopButton__12:hover::after, .containerTimeline .workShopButton__13:hover::after, .containerTimeline .workShopButton__14:hover::after {
