sources.css\\main.scss:
    $bleu: #09021e;
    $cyan: #4cc9f0;
    $magenta: #f72585;

    * {
        box-sizing: border-box;
        cursor: none !important;
        // cursor: auto;
        user-select: none;
    }

    html {
        height: auto;
        overflow-x: initial;

        body {
            height: auto;
        }
    }

    body {
        margin: 0;
        padding: 0;
        width: 100%;
        background: $bleu;
        overflow: hidden;
    }

    .homeMask {
        position: absolute;
        left: 0;
        top: 0;
        background: rgba(9, 2, 30, 0.4);
        z-index: 2;
        width: 100%;
        height: 100vh;
    }

    canvas {
        display: block;
        position: absolute;
        height: 100vh;
        width: 100vw;
        z-index: -1;
        opacity: 1;
        top: 0;
        left: 0;

        &.hologramActive {
            transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
            animation: blinkCanvas 6s infinite;
        }

        &.hologramDefault {
            transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
            animation: none;
        }

        @keyframes blinkCanvas {
            30% {
                opacity: 1;
            }

            32% {
                opacity: .825;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .825;
            }

            40% {
                opacity: 1;
            }

            80% {
                opacity: .825;
            }

            82% {
                opacity: 1;
            }

            85% {
                opacity: .825;
            }

            87% {
                opacity: 1;
            }
        }
    }

    ////CURSOR CUSTOM///
    @media screen and (max-width: 1024px) {
        .cursor {
            display: none;
        }

        .cursor-shape_out {
            display: none;
        }

        .cursor-shape_out.mouseover {
            display: none;
        }
    }

    .cursor {
        position: fixed;
        pointer-events: none;
        z-index: 100;
        mix-blend-mode: difference;
        opacity: 0;
    }

    .tailleBoulette {
        position: absolute;
        pointer-events: none;
        width: 20px;
        height: 20px;
        padding: 0;
        left: 0;
        top: 0;
        border-radius: 50px;
    }

    .cursor-shape_in {
        position: absolute;
        pointer-events: none;
        border-radius: 50px;
        left: 0;
        top: 0;
        width: 20px;
        height: 20px;
        background: $cyan;
        transition: opacity .75s cubic-bezier(.25, 0, 0, 1);

        &.mouseover {
            transition: opacity .5s cubic-bezier(.25, 0, 0, 1);
            opacity: 0;
        }
    }

    .cursor-shape_out {
        opacity: 1;
        mix-blend-mode: difference;
        z-index: 99;
        position: absolute;
        pointer-events: none;
        border-radius: 50px;
        left: 0;
        top: 0;
        width: 50px;
        height: 50px;
        border: $cyan solid 1px;
        transition: padding .75s cubic-bezier(.25, 0, 0, 1);
    }

    .indicClickOnPlane {
        opacity: 0;
        z-index: 100;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-37%, 20%);
        color: $cyan;
        pointer-events: none;
        font-family: littleTitle;
        font-size: 11px;
        font-weight: bold;
        letter-spacing: 1.5px;
        transition: opacity .1s cubic-bezier(.75, 0, 0, 1);

        &.planeHover {
            transition: opacity .75s cubic-bezier(.75, 0, 0, 1);
            opacity: 1;
        }
    }

    ////MAIN///
    .workShopContainer {
        width: 100%;
        height: 100vh;
        position: fixed;
        z-index: 2;
        opacity: 0;
        pointer-events: none;
        display: flex;
        justify-content: center;
        align-items: center;

        &.switchPlane {
            pointer-events: all;
        }

        .contentContainer {
            display: none;
            width: 100%;
            height: 100vh;
            background: rgba(9, 2, 30, 0.6);
            overflow: auto;
            -ms-overflow-style: none;
            scrollbar-width: none;

            &::-webkit-scrollbar {
                display: none;
            }

            .title {
                text-align: center;
                font-family: "main";
                font-size: 6vw;
                margin: 43vh auto 25vh auto;
                color: $cyan;
            }

            .containerPara__1 {
                width: 100%;
                display: flex;
                justify-content: flex-end;
                align-items: center;

                .para {
                    width: 25%;
                    margin: 22vh 22vw 22vh 0;
                    display: flex;
                    flex-direction: column;
                    align-items: flex-end;

                    .subtitle {
                        font-family: "littleTitle";
                        font-size: 25px;
                        color: $magenta;
                        margin: 0;
                    }

                    .text {
                        font-family: "text";
                        text-align: justify;
                        color: $cyan;
                    }
                }
            }

            .containerPara__2 {
                width: 100%;
                display: flex;
                justify-content: start;
                align-items: center;

                .para {
                    width: 25%;
                    margin: 22vh 0 22vh 22vw;
                    display: flex;
                    flex-direction: column;
                    align-items: start;
                    justify-content: center;

                    .subtitle {
                        font-family: "littleTitle";
                        font-size: 25px;
                        color: $magenta;
                        margin: 0;
                    }

                    .text {
                        font-family: "text";
                        text-align: justify;
                        color: $cyan;
                    }
                }
            }

            .containerPara__3 {
                width: 100%;
                display: flex;
                justify-content: flex-end;
                align-items: center;

                .para {
                    width: 25%;
                    margin: 22vh 22vw 100vh 0;
                    display: flex;
                    flex-direction: column;
                    align-items: flex-end;

                    .subtitle {
                        font-family: "littleTitle";
                        font-size: 25px;
                        color: $magenta;
                        margin: 0;
                    }

                    .text {
                        font-family: "text";
                        text-align: justify;
                        color: $cyan;
                    }
                }
            }
        }
    }

    .creditContainer {
        width: 100%;
        height: 100vh;
        position: fixed;
        z-index: 2;
        opacity: 0;
        pointer-events: none;
        display: none;
        justify-content: center;
        align-items: center;

        &.switchStreet {
            pointer-events: all;
            display: flex;
        }

        .scrollContainer {
            display: none;
            width: 100%;
            height: 100vh;
            margin: 0;
            overflow: scroll;
            // display: flex;
            justify-content: center;
            align-items: center;
            scrollbar-width: none;
            &::-webkit-scrollbar {
                display: none;
            }

            .trombi {
                    display: flex;
                    justify-content: center;
                    align-items: start;
                    flex-wrap: wrap;
                    width: 80%;
                    height: 100vh;

                    .contentImg {
                        display: flex;
                        justify-content: center;
                        align-items: center;
                        flex-wrap: wrap;
                        margin-left: 10%;
                        margin-right: 10%;
                        position: relative;
                        opacity: 0;

                        &__2,
                        &__4,
                        &__6 {
                            margin-top: 21.5%;
                        }

                        .prenom {
                            color: $cyan;
                            position: absolute;
                            left: 13.7%;
                            top: 60%;
                            writing-mode: vertical-rl;
                            text-orientation: mixed;
                            font-family: "littleTitle";
                            font-size: 25px;
                            color: $magenta;
                            font-weight: bold;
                            letter-spacing: 25px;
                            opacity: 0;
                            transform: translate(-50%, -50%) rotate(180deg);
                            transition: .5s cubic-bezier(.25, 0, 0, 1);
                            filter: blur(5px);

                            &.switch {
                                top: 50%;
                                letter-spacing: 10px;
                                opacity: 1;
                                filter: blur(0);
                            }
                        }

                        .nom {
                            color: $cyan;
                            position: absolute;
                            right: 6%;
                            top: 40%;
                            opacity: 0;
                            writing-mode: vertical-rl;
                            text-orientation: mixed;
                            font-family: "littleTitle";
                            font-size: 25px;
                            color: $magenta;
                            font-weight: bold;
                            letter-spacing: 25px;
                            transform: translate(-50%, -50%);
                            transition: .5s cubic-bezier(.25, 0, 0, 1);
                            filter: blur(5px);

                            &.switch {
                                top: 50%;
                                letter-spacing: 10px;
                                opacity: 1;
                                filter: blur(0);
                            }
                        }

                        .content {
                            width: 450px;
                            height: 100%;
                            clip-path: inset(4% 4% 4% 4%);
                            transition: .5s ease;
                            margin: 20%;
                            position: relative;

                            &.switch {
                                clip-path: inset(1% 1% 1% 1%);
                            }

                            .mask {
                                position: absolute;
                                opacity: 0;
                                left: 0;
                                top: 0;
                                width: 100%;
                                height: 100%;
                                background: $cyan;
                                z-index: 2;
                                clip-path: "inset(0% 100% 0% 0%)";
                            }

                            .r1 {
                                position: absolute;
                                bottom: -2%;
                                left: 25%;
                                font-family: "text";
                                color: $cyan;
                                font-size: 15px;
                                z-index: 3;
                                opacity: 0;
                                transition: .5s cubic-bezier(.25, 0, 0, 1);
                                text-decoration: none;

                                &.switch {
                                    opacity: 1;
                                    bottom: 3%;
                                }

                                &::after {
                                    bottom: 3%;
                                    content: ' ';
                                    position: absolute;
                                    left: 0;
                                    background: $cyan;
                                    height: 1px;
                                    width: 100%;
                                    clip-path: inset(0 100% 0 0);
                                    transition: .5s cubic-bezier(.25, 0, 0, 1);
                                }

                                &:hover::after {
                                    clip-path: inset(0 0 0 0);
                                }
                            }

                            .r2 {
                                position: absolute;
                                bottom: -2%;
                                right: 25%;
                                font-family: "text";
                                color: $cyan;
                                font-size: 15px;
                                z-index: 3;
                                opacity: 0;
                                transition: .5s cubic-bezier(.25, 0, 0, 1);
                                text-decoration: none;

                                &.switch {
                                    opacity: 1;
                                    bottom: 3%;
                                }

                                &::after {
                                    content: ' ';
                                    bottom: 3%;
                                    position: absolute;
                                    right: 0;
                                    background: $cyan;
                                    height: 1px;
                                    width: 100%;
                                    clip-path: inset(0 100% 0 0);
                                    transition: .5s cubic-bezier(.25, 0, 0, 1);
                                }

                                &:hover::after {
                                    clip-path: inset(0 0 0 0);
                                }
                            }

                            &::after {
                                content: "";
                                position: absolute;
                                left: 0;
                                top: 0;
                                width: 100%;
                                height: 100%;
                                background: #09021e;
                                z-index: -1;
                            }

                            .faceImg {
                                width: 100%;
                                opacity: 1;
                                transform: scale(1.3);
                                transition: 1s cubic-bezier(.25, 0, 0, 1);

                                &.switch {
                                    transform: scale(1);
                                    opacity: 0.5;
                                }
                            }
                        }
                    }
            }
        }
    }


    .title,
    .littleTitle {
        width: 50vw;
        animation: blinkTitle 8s infinite ease-in-out alternate;

        @media screen and (max-width: '539px') {
            width: 90vw;
        }
    }

    .littleTitle {
        z-index: 3;
        width: 150px;
        position: absolute;
        right: 18px;
        top: 1.2%;

        @media screen and (max-width: 1024px) {
            display: none;
        }
    }

    .title,
    .littleTitle {

        path,
        line {
            fill: none;
            stroke: #4CC9F0;
            stroke-width: 0.5;
            stroke-miterlimit: 10;
            stroke-dashoffset: -1000;
            stroke-dasharray: 1000;
        }
    }

    .pathTitleIn {
        animation: titleIn 8s forwards ease-in-out;
    }

    .pathLineIn {
        animation: lineIn 6.5s forwards ease-in-out;
    }

    .pathTitleOut {
        animation: titleOut 8s forwards ease-in-out;
    }

    .pathLineOut {
        animation: lineOut 6.5s forwards ease-in-out;
    }

    @keyframes titleIn {
        0% {
            stroke-dashoffset: -1000;
        }

        40% {
            stroke-dashoffset: 0;
            fill: transparent;
        }

        45% {
            fill: $cyan;
        }

        70% {
            fill: $cyan;
        }

        100% {
            fill: $cyan;
            stroke-dashoffset: 0;
        }
    }

    @keyframes titleOut {
        0% {
            stroke-dashoffset: 0;
            fill: $cyan;
        }

        10% {
            fill: transparent;
        }

        80% {
            stroke-dashoffset: -1000;
            fill: transparent;
        }

        85% {
            fill: transparent;
        }

        100% {
            fill: transparent;
            stroke-dashoffset: -1000;
        }
    }

    @keyframes lineIn {
        0% {
            stroke-dashoffset: -1000;
            stroke-width: 0.5px;
        }

        40% {
            stroke-dashoffset: 0;
            fill: transparent;
            stroke-width: 0.5px;
        }

        45% {
            fill: transparent;
            stroke-width: 0.5px;
        }

        70% {
            stroke-width: 4px;
            stroke-dashoffset: 0;
        }

        100% {
            stroke-width: 4px;
            stroke-dashoffset: 0;
        }
    }

    @keyframes lineOut {
        0% {
            stroke-dashoffset: 0;
            stroke-width: 4px;
        }

        10% {
            stroke-width: 0.5px;
        }

        80% {
            stroke-dashoffset: -1000;
            stroke-width: 0.5px;
        }

        85% {
            stroke-width: 0.5px;
        }

        100% {
            stroke-width: 0.5px;
            stroke-dashoffset: -1000;
        }
    }

    @keyframes blinkTitle {
        0% {
            opacity: 1;
            filter: drop-shadow(0 0 1.5px $cyan);
        }

        20% {
            opacity: 1;
            filter: drop-shadow(0 0 3px $cyan);
        }

        40% {
            opacity: 1;
            filter: drop-shadow(0 0 1.5px $cyan);
        }

        60% {
            opacity: 1;
            filter: drop-shadow(0 0 3px $cyan);
        }

        80% {
            opacity: 1;
            filter: drop-shadow(0 0 1.5px $cyan);
        }

        100% {
            opacity: 1;
            filter: drop-shadow(0 0 3px $cyan);
        }
    }

    .homeContainer {
        display: flex;
        align-items: center;
        justify-content: center;
        flex-direction: column;
        height: 100vh;
        width: 100%;
        position: fixed;
        display: flex;
        z-index: 2;
    }

    ////BUTTONS///
    .btn {
        outline: none;
        font-family: "littleTitle";
        font-size: 15px;
        letter-spacing: 1px;
        background: $bleu;
        color: $cyan;
        border: 1px solid $cyan;
        width: 225px;
        height: 55px;
        overflow: hidden;
        position: relative;
        clip-path: inset(0% 0% 0% 0%);
        transition: border .75s cubic-bezier(.25, 0, 0, 1);
        z-index: 10;

        @media screen and (max-width: 539px) {
            width: 53vw;
            font-size: 2.2vh;
            height: 6.5vh;
            letter-spacing: .2vw;
        }

        @media screen and (width: 375px) and (height: 812px) {
            font-size: 1.9vh;
        }

        &__start {
            transition: border .75s cubic-bezier(.25, 0, 0, 1);

            &.hover {
                transition: border .75s cubic-bezier(.25, 0, 0, 1);
                border: 1px solid $bleu;
            }

            .spanContainerStartMouseout.neonText {
                animation: blinkBtn 4s infinite alternate;
            }

            .spanContainerStartMouseover,
            .spanContainerStartMouseout {
                position: absolute;
                transform: translate(-50%, -50%);
                top: 50%;
                left: 50%;
                width: 100%;
                height: 100%;
                clip-path: inset(35% 0 35% 0);
            }

            .spanContainerStartMouseover span,
            .spanContainerStartMouseout span {
                display: inline-block;
                line-height: 53px;

                @media screen and (max-width: 539px) {
                    line-height: 6.5vh;
                }
            }

            .spanContainerStartMouseout span {
                transform: translateY(40px);
            }
        }

        &__backHome {
            width: 100px;
            height: 55px;
            top: 2.25%;
            left: 30px;
            position: absolute;
            clip-path: inset(0% 100% 0% 0%);
            transition: border .75s cubic-bezier(.25, 0, 0, 1);

            // transition: .75s cubic-bezier(.25, 0, 0, 1);
            @media screen and (max-width: 539px) {
                width: 22.5vw;
                height: 6.5vh;
                left: 2%;
                top: 1.2%;
            }

            .spanContainerBackMouseout.neonText {
                animation: blinkBtn 4s infinite alternate;
            }

            .spanContainerBackMouseover,
            .spanContainerBackMouseout {
                position: absolute;
                transform: translate(-50%, -50%);
                top: 50%;
                left: 50%;
                width: 100%;
                height: 100%;
                clip-path: inset(35% 0 35% 0);
            }

            .spanContainerBackMouseover span,
            .spanContainerBackMouseout span {
                display: inline-block;
                line-height: 55px;

                @media screen and (max-width: 539px) {
                    line-height: 6.3vh;
                }
            }

            .spanContainerBackMouseout span {
                transform: translateY(40px);
            }

            @media screen and (max-width: 539px) {
                width: 22.5vw;
                height: 6.5vh;
                left: 2%;
                top: 1.2%;
            }
        }

        &__backWorkshop {
            width: 100px;
            height: 55px;
            top: 2.25%;
            left: 24px;
            position: absolute;
            clip-path: inset(0% 100% 0% 0%);
            transition: border .75s cubic-bezier(.25, 0, 0, 1);

            @media screen and (max-width: 539px) {
                width: 22.5vw;
                height: 6.5vh;
                left: 2%;
                top: 1.2%;
            }

            .spanContainerBackWorkshopMouseout.neonText {
                animation: blinkBtn 4s infinite alternate;
            }

            .spanContainerBackWorkshopMouseover,
            .spanContainerBackWorkshopMouseout {
                position: absolute;
                transform: translate(-50%, -50%);
                top: 50%;
                left: 50%;
                width: 100%;
                height: 100%;
                clip-path: inset(35% 0 35% 0);
            }

            .spanContainerBackWorkshopMouseover span,
            .spanContainerBackWorkshopMouseout span {
                display: inline-block;
                line-height: 55px;

                @media screen and (max-width: 539px) {
                    line-height: 6.3vh;
                }
            }

            .spanContainerBackWorkshopMouseout span {
                transform: translateY(40px);
            }

            @media screen and (max-width: 539px) {
                width: 22.5vw;
                height: 6.5vh;
                left: 2%;
                top: 1.2%;
            }
        }

        &__discord {
            background: none;
            border: none;
            width: fit-content;
            height: 47px;
            position: absolute;
            right: 18px;
            top: 1.5%;
            padding: 0 10px;

            span {
                opacity: 0.6;
            }
        }

        &__iut {
            background: none;
            border: none;
            width: fit-content;
            height: 47px;
            position: absolute;
            left: 18px;
            top: 1.5%;
            padding: 0 10px;

            span {
                opacity: 0.6;
            }
        }
    }

    .open {
        pointer-events: all;
    }

    .close {
        pointer-events: none;
    }

    .hover {
        transition: border .75s cubic-bezier(.25, 0, 0, 1);
        border: 1px solid $bleu;
    }



    ////GRID///
    .colContainer {
        position: absolute;
        width: 100%;
        height: 100vh;
        z-index: -1;

        .col {
            clip-path: inset(100% 0% 0% 0%);
        }
    }

    .rowContainer {
        position: absolute;
        width: 100%;
