    ////CURSOR INDICATION////

    .mobileIndication {
        display: none;
    }

    @media screen and (max-width: 1024px) {
        .mobileIndication {
            position: absolute;
            top: 6.8%;
            left: 50%;
            z-index: 10;
            transform: translate(-50%, -50%);
            height: 20px;
            width: fit-content;
            height: fit-content;
            justify-content: center;
            align-items: center;
            display: none;
            display: flex;


            .mobileTextIndic {
                font-family: 'littleTitle';
                font-size: 3vw;
                letter-spacing: .2vw;
                font-weight: 600;
                color: $cyan;

                @media screen and (min-width: 600px) {
                    letter-spacing: 2px;
                    font-size: 13px;
                    font-weight: 600;
                }
            }
        }
    }

    .cursorIndication {
        position: absolute;
        top: 6.8%;
        left: 50%;
        z-index: 10;
        transform: translate(-50%, -50%);
        height: 20px;
        width: fit-content;
        height: fit-content;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        opacity: 0;
        transition: 1.5s cubic-bezier(.25, 0, 0, 1);

        &.switch {
            opacity: 1;
        }

        @media screen and (max-width: 1024px) {
            display: none;
        }

        @media screen and (max-height: 850px) {
            top: 12%;
        }

        .keyboardIndicationContainer {
            width: 180px;
            height: 60px;
            top: -5px;
            text-align: center;
            display: flex;
            position: absolute;
            justify-content: center;
            flex-direction: column;
            align-items: center;
            opacity: 1;
            filter: blur(0);
            transform: translateX(34px);
            animation: keyboard 6s ease-in-out infinite alternate;

            @keyframes keyboard {
                0% {
                    opacity: 0;
                    filter: blur(2px);
                    transform: translateX(34px);
                }

                46% {
                    opacity: 0;
                    filter: blur(2px);
                    transform: translateX(34px);
                }

                54% {
                    opacity: 1;
                    filter: blur(0);
                    transform: translateX(-6px);
                }

                100% {
                    opacity: 1;
                    filter: blur(0);
                    transform: translateX(-6px);
                }
            }

            .echapIndication {
                width: 25px;
                height: 25px;
                border: 1px solid $cyan;
                color: $cyan;
                font-family: 'littleTitle';
                font-size: 8.5px;
                position: absolute;
                top: 3.5px;
                left: -17px;
                display: flex;
                justify-content: center;
                align-items: center;
                transform: translateX(34px);
                animation: touch 3s ease-in-out infinite;
                animation-delay: .25s;

                &::after {
                    content: "esc";
                }
            }

            .enterIndication {
                width: 30px;
                height: 40px;
                border: 1px solid $cyan;
                color: $cyan;
                font-family: 'littleTitle';
                font-size: 14px;
                position: absolute;
                top: 3.5px;
                left: 105px;
                display: flex;
                justify-content: center;
                align-items: center;
                transform: translateX(34px);
                animation: touch 3s ease-in-out infinite;

                &::after {
                    content: "⮤";
                    margin-top: -10px;
                    transform: rotate(-90deg);
                }
            }

            .enterIndication2 {
                width: 30px;
                height: 40px;
                border: 1px solid $cyan;
                position: absolute;
                bottom: -8px;
                left: 83px;
                background: $bleu;
                clip-path: inset(0 0 60% 72%);
                transform: translateX(34px);
            }

            .up {
                width: 25px;
                height: 25px;
                margin: 0 0 2px 0;
                border: 1px solid $cyan;
                display: flex;
                justify-content: center;
                align-items: center;
                animation: touch 3s ease-in-out infinite;
                background: #4ccaf027;

                @keyframes touch {
                    0% {
                        background: #4ccaf027;
                    }

                    50% {
                        background: #4ccaf000;
                    }

                    100% {
                        background: #4ccaf027;
                    }
                }

                .arrow {
                    width: 7px;
                    height: 7px;
                    border-top: 1px solid $cyan;
                    border-left: 1px solid $cyan;
                    transform: rotate(45deg);
                }
            }

            .touch {
                width: 115px;
                height: 25px;
                display: flex;
                justify-content: center;
                align-items: center;
                flex-direction: inline;

                .blockKeyboard {
                    width: 25px;
                    height: 25px;
                    margin: 0 1px 0 1px;
                    border: 1px solid $cyan;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                    animation: touch 3s ease-in-out infinite;

                    &:nth-child(1) {
                        animation-delay: .5s;
                    }

                    &:nth-child(2) {
                        animation-delay: .25s;
                    }

                    &:nth-child(3) {
                        animation-delay: .75s;
                    }

                    .arrowLeft {
                        width: 7px;
                        height: 7px;
                        border-top: 1px solid $cyan;
                        border-left: 1px solid $cyan;
                        transform: rotate(-45deg);
                    }

                    .arrowRight {
                        width: 7px;
                        height: 7px;
                        border-top: 1px solid $cyan;
                        border-left: 1px solid $cyan;
                        transform: rotate(135deg);
                    }

                    .arrowDown {
                        width: 7px;
                        height: 7px;
                        border-top: 1px solid $cyan;
                        border-left: 1px solid $cyan;
                        transform: rotate(-135deg);
                    }
                }
            }

        }

        .mouseIndication {
            width: 32px;
            height: 50px;
            text-align: center;
            border: 1px solid $cyan;
            display: flex;
            justify-content: center;
            align-items: center;
            margin-bottom: 12px;
            border-radius: 10px;
            opacity: 0;
            filter: blur(2px);
            transform: translateX(-13px);
            animation: mouse 6s ease-in-out infinite alternate;
            background: #4ccaf027;

            @keyframes mouse {
                0% {
                    background: #4ccaf027;
                    opacity: 1;
                    filter: blur(0);
                    transform: translateX(-13px);
                }

                20% {
                    background: #4ccaf000;
                }

                40% {
                    background: #4ccaf027;
                }

                46% {
                    opacity: 1;
                    filter: blur(0);
                    transform: translateX(-13px);
                }

                54% {
                    opacity: 0;
                    filter: blur(2px);
                    transform: translateX(-53px);
                }

                60% {
                    background: #4ccaf000;
                }

                80% {
                    background: #4ccaf027;
                }

                100% {
                    background: #4ccaf000;
                    opacity: 0;
                    filter: blur(2px);
                    transform: translateX(-53px);
                }
            }

            .containerPointMouse {
                display: flex;
                justify-content: center;
                align-items: center;
                flex-direction: column;
                margin-bottom: 12px;

                .blockMouse {
                    width: 2px;
                    height: 2px;
                    background: $cyan;
                    margin: 1px 0 1px 0;
                    opacity: 0;
                    filter: blur(2px);
                    transform: scale(0);
                    animation: pointMouse .75s cubic-bezier(.75, 0, 0, 1) infinite alternate;

                    &:nth-child(1) {
                        animation-delay: 0s;
                    }

                    &:nth-child(2) {
                        animation-delay: .1s;
                    }

                    &:nth-child(3) {
                        animation-delay: .2s;
                    }

                    @keyframes pointMouse {
                        0% {
                            opacity: 0;
                            filter: blur(2px);
                            transform: scale(0);
                        }

                        100% {
                            opacity: 1;
                            filter: blur(0);
                            transform: scale(1);
                        }
                    }
                }

            }

        }

        .textIndication {
            display: flex;
            justify-content: center;
            align-items: center;

            .indic {
                font-family: 'littleTitle';
                letter-spacing: 2px;
                font-size: 13px;
                font-weight: 600;
                color: $cyan;
            }

            .indicContainer {
                font-family: 'littleTitle';
                letter-spacing: 2px;
                font-size: 13px;
                font-weight: 600;
                color: $cyan;
                display: flex;
                flex-direction: column;
                justify-content: center;
                position: relative;
                width: 120px;
                height: 20px;
                overflow: hidden;

                .text {
                    width: 120px;
                    margin: 0 0 0 4px;
                    position: absolute;
                }

                .mouse {
                    animation: textMouse 6s ease-in-out infinite alternate;
                }

                @keyframes textMouse {
                    0% {
                        transform: translateY(0);
                        filter: blur(0px);
                        opacity: 1;
                    }

                    46% {
                        transform: translateY(0);
                        filter: blur(0px);
                        opacity: 1;
                    }

                    54% {
                        transform: translateY(40px);
                        filter: blur(2px);
                        opacity: 0;
                    }

                    100% {
                        transform: translateY(40px);
                        filter: blur(2px);
                        opacity: 0;
                    }
                }

                .keyboard {
                    animation: textKeyboard 6s ease-in-out infinite alternate;
                }

                @keyframes textKeyboard {
                    0% {
                        transform: translateY(-40px);
                        filter: blur(2px);
                        opacity: 0;
                    }

                    46% {
                        transform: translateY(-40px);
                        filter: blur(2px);
                        opacity: 0;
                    }

                    54% {
                        transform: translateY(0);
                        filter: blur(0px);
                        opacity: 1;
                    }

                    100% {
                        transform: translateY(0);
                        filter: blur(0px);
                        opacity: 1;
                    }
                }

            }

        }

    }

    ////MUSIC BUTTON///
    .musicBtn {
        width: fit-content;
        height: 42px;
        padding: 12px;
        left: 24px;
        bottom: 1.8%;
        position: absolute;
        display: flex;
        justify-content: center;
        align-items: center;
        z-index: 3;
        height: fit-content;

        @media screen and (max-width: 539px) {
            left: 1.8%;
            bottom: 0;
            padding: 0;
            height: 30px;
        }

        .lineContainer {
            display: flex;
            justify-content: center;
            align-items: center;
            width: fit-content;
            height: fit-content;

            .soundMask {
                width: 56px;
                height: 21px;
                position: absolute;
                margin: 0 2px 2px 2px;
                background: $cyan;
                clip-path: inset(100% 0 0 0);
            }

            .line {
                width: 1px;
                background: $cyan;
                height: 18px;
                margin: 0 2px 0 2px;
                clip-path: inset(90% 0 0 0);
                z-index: -1;

                &.switch {
                    animation: soundLines .75s ease-in-out infinite alternate;
                }

                &.switch:nth-child(1) {
                    animation-delay: 0s
                }

                &.switch:nth-child(2) {
                    animation-delay: .7s
                }

                &.switch:nth-child(3) {
                    animation-delay: .2s
                }

                &.switch:nth-child(4) {
                    animation-delay: .5s
                }

                &.switch:nth-child(5) {
                    animation-delay: .9s
                }

                &.switch:nth-child(6) {
                    animation-delay: .1s
                }

                &.switch:nth-child(7) {
                    animation-delay: .6s
                }

                &.switch:nth-child(8) {
                    animation-delay: .3s
                }

                &.switch:nth-child(9) {
                    animation-delay: 1s
                }

                &.switch:nth-child(10) {
                    animation-delay: .4s
                }

                &.switch:nth-child(11) {
                    animation-delay: .6s
                }
            }

            @keyframes soundLines {
                0% {
                    clip-path: inset(90% 0 0 0);
                }

                100% {
                    clip-path: inset(0 0 0 0);
                }
            }
        }

        .containerIndication {
            width: 40px;
            height: 16px;
            position: relative;
            overflow: hidden;

            .on,
            .off {
                margin: 0 0 0 7px;
                font-family: 'littleTitle';
                letter-spacing: 2px;
                font-size: 13px;
                font-weight: 600;
                color: $cyan;
                position: absolute;
                transition: .75s cubic-bezier(.75, 0, 0, 1);

                @media screen and (max-width: "539px") {
                    font-size: 3vw;
                }
            }

            .on {
                text-shadow: 0px;
                transform: translateY(50px);
                opacity: 0;
                filter: blur(2px);

                &.switch {
                    transform: translateY(0);
                    opacity: 1;
                    filter: blur(0);
                }
            }

            .off {
                transform: translateY(0);
                opacity: 1;
                filter: blur(0);

                &.switch {
                    transform: translateY(-50px);
                    opacity: 0;
                    filter: blur(2px);
                }
            }
        }
    }

    ////SOCIALS MEDIA///
    .sm {
        width: 42px;
        height: 42px;
        position: absolute;
        right: 18px;
        color: $cyan;
        display: flex;
        justify-content: center;
        align-items: center;
        z-index: 10;
        font-family: 'littleTitle';
        letter-spacing: 2px;
        font-size: 13px;
        overflow: hidden;
        font-weight: 600;

        @media screen and (max-width: 539px) {
            right: .8%;
            font-size: 3vw;
            width: 30px;
            height: 30px;
            letter-spacing: .2vw;
        }

        &.neonText {
            text-shadow: 0px;
            animation: blink 4s infinite alternate;
        }

        @keyframes blink {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $cyan, 0 0 2px $cyan, 0 0 2px $cyan;
            }

            32% {
                opacity: .25;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .25;
            }

            40% {
                opacity: 1;
            }
        }

        @keyframes blinkSound {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $cyan, 0 0 1px $cyan, 0 0 1px $cyan;
            }

            32% {
                opacity: .6;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .6;
            }

            40% {
                opacity: 1;
            }
        }

        @keyframes blinkBtn {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $bleu, 0 0 1px $bleu, 0 0 1px $bleu;
            }

            32% {
                opacity: .65;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .65;
            }

            40% {
                opacity: 1;
                text-shadow: 0 0 0 $bleu, 0 0 1px $bleu, 0 0 1px $bleu;
            }
        }

        @keyframes inSM {
            to {
                transform: translateX(0);
            }
        }

        @keyframes outSM {
            to {
                transform: translateX(175%);
            }
        }

        @keyframes outImpairSM {
            to {
                transform: translateX(-175%);
            }
        }

        &__1 {
            bottom: 1.8%;

            @media screen and (max-width: 539px) {
                bottom: .5%;
            }

            &.mouseover::after {
                content: "FB";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "FB";
                position: absolute;
                transform: translateX(-175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "FB";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(-175%);
            }

            &.mouseout::before {
                content: "FB";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }

        &__2 {
            bottom: 6.2%;

            @media screen and (max-width: 539px) {
                bottom: 5.5%;
            }

            &.mouseover::after {
                content: "IG";
                position: absolute;
                animation: outImpairSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "IG";
                position: absolute;
                transform: translateX(175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "IG";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(175%);
            }

            &.mouseout::before {
                content: "IG";
                position: absolute;
                animation: outImpairSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }

        &__3 {
            bottom: 10.6%;

            @media screen and (max-width: 539px) {
                bottom: 10.5%;
            }

            &.mouseover::after {
                content: "IN";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "IN";
                position: absolute;
                transform: translateX(-175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "IN";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(-175%);
            }

            &.mouseout::before {
                content: "IN";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }
    }

    ////TIMELINE///

    .containerTimeline {
        width: fit-content;
        height: fit-content;
        position: absolute;
        top: 27.7vh;
        z-index: 10;
        display: flex;
        right: 0;
        flex-direction: column;
        align-items: flex-end;
        padding: 25px 18px 25px 25px;
        overflow: hidden;
        transition: .75s cubic-bezier(.75, 0, 0, 1);
        clip-path: inset(0 0 0 70%);
        text-align: center;
        pointer-events: none;

        @media screen and (max-width: 1024px) {
            display: none;
        }

        @media screen and (max-height: 850px) {
            top: 16vh;
        }

        &.switch {
            pointer-events: all;
        }

        .timelineIndication {
            .indication {
                color: $cyan;
                font-family: "littleTitle";
                writing-mode: vertical-rl;
                text-orientation: mixed;
                letter-spacing: 8px;
                font-size: 14px;
                font-weight: 600;
                position: absolute;
                transform: translate(-50%, -50%);
                right: 22px;
                top: 50%;
                opacity: 0;
                transition: 1s cubic-bezier(.75, 0, 0, 1);

                &.switch {
                    opacity: 1;
                }
            }
        }

        .workShopButton {
            width: fit-content;
            margin: .6vh 0 .6vh 0;
            padding: 0 10px 0 10px;
            font-family: "littleTitle";
            overflow: hidden;
            color: $cyan;
            font-size: 14px;
            letter-spacing: .5px;
            position: relative;
            transition: .5s cubic-bezier(.75, 0, 0, 1);
            clip-path: inset(0 0 0 99%);
            font-weight: normal;
            transform: translateX(25%);
            opacity: 0;
            filter: blur(2px);

            &:hover {
                color: $bleu;
                font-weight: bold;
            }

            &::before {
                content: " ";
                width: 2px;
                right: 0;
                position: absolute;
                background: $cyan;
                transition: .5s cubic-bezier(.75, 0, 0, 1);
                z-index: -1;
            }

            &:hover::before {
                width: 100%;
                background: $cyan;
                right: 0;
            }

            &__1,
            &__2,
            &__3,
            &__4,
            &__5,
            &__6,
            &__7,
            &__8,
            &__9,
            &__10,
            &__11,
            &__12,
            &__13,
            &__14 {
                &::after {
                    content: " ";
                    position: absolute;
                    left: 0;
                    padding: 0 20px 0 20px;
                    transition: .5s cubic-bezier(.75, 0, 0, 1);
                    width: 100%;
                    height: 100%;
                    background: $cyan;
                    clip-path: inset(0 100% 0 0);
                    z-index: -1;
                }

                &:hover::after {
                    clip-path: inset(0 0 0 0);
                }
            }

            .mask {
                position: absolute;
                width: 100%;
                right: 0;
                background: $cyan;
            }
        }
    }

